Descrição:
O livro "A Arte da Prudência"  do importante  escritor espanhol do século XVII Baltasar Gracían caracteriza-se por uma manual de estratégia para a vida . Neste livro através dos 300 preceitos morais são  explanadas as questões sobre as  relações humanas, tendo como princípio a instabilidade do ser humano no campo emocional. Na sua obra o escritor  não usa sentimentalismos, ou utopias. Seu modo de pensar se baseia na realidade dos fatos. Para Gracian, o ser humano é imprevisível e age em todo o tempo buscando seus próprios interesses. Ser precavido ante as circunstâncias para obter o equilíbrio é a base de seus ensinamentos.

